namespace V1
{
    // Concatenate std::string, which involves a lot of redundant copying.
    std::string toBinary(int decimal)
    {
        const auto nextBit{ (decimal % 2 == 0) ? "0" : "1" };
        decimal /= 2;
        if (decimal == 0)
        {
            return nextBit;
        }

        return toBinary(decimal) + nextBit;
    }
}

namespace V2
{
    // Use a single std::string instance to avoid copies
    void toBinary_impl(int decimal, std::string& o_binary)
    {
        const auto nextBit{ (decimal % 2 == 0) ? "0" : "1" };
        o_binary.insert(0, nextBit);

        decimal /= 2;
        if (decimal != 0)
        {
            toBinary_impl(decimal, o_binary);
        }
    }

    std::string toBinary(int decimal)
    {
        std::string binary{};
        toBinary_impl(decimal, binary);

        return binary;
    }
}

namespace V3
{
    // It's faster to append than prepend to a string, because we avoid moving
    // of previous letters. Hence it's probably more efficient to create a
    // reversed representation (and than reverse the final result).
    void toBinary_reversed(int decimal, std::string& o_binary)
    {
        const auto nextBit{ (decimal % 2 == 0) ? "0" : "1" };
        o_binary += nextBit;

        decimal /= 2;
        if (decimal != 0)
        {
            toBinary_reversed(decimal, o_binary);
        }
    }

    void toBinary_impl(int decimal, std::string& o_binary)
    {
        /* reserve() commented out, see Summary below */
/*        // Preallocate memory for binary representation
        const std::size_t numBitsRequired{
            static_cast<std::size_t>(
                std::ceil(std::log2(decimal + 1))
            )
        };
        o_binary.reserve(numBitsRequired);*/

        toBinary_reversed(decimal, o_binary);
        std::ranges::reverse(o_binary);
    }

    std::string toBinary(int decimal)
    {
        std::string binary{};
        toBinary_impl(decimal, binary);

        return binary;
    }
}

namespace V4
{
    static std::string binary{};

    // Use the same std::string object for all invocations, and return a copy.
    // Performs similar to V3 (as per the results below).
    std::string toBinary(int decimal)
    {
        binary.clear();
        V3::toBinary_impl(decimal, binary);

        return binary;
    }
}

namespace V5
{
    // Iterative instead of recursive.
    std::string toBinary(int decimal)
    {
        std::string binary{};
        /* reserve() commented out, see Summary below */
/*
        // Preallocate memory for binary representation
        const std::size_t numBitsRequired{
            static_cast<std::size_t>(
                std::ceil(std::log2(decimal + 1))
            )
        };
        binary.reserve(numBitsRequired);*/

        do
        {
            const auto nextBit{ (decimal % 2 == 0) ? "0" : "1" };
            binary.insert(0, nextBit);
            decimal /= 2;
        }
        while (decimal != 0);

        return binary;
    }
}

